import Layout from '../components/Layout';



const Login = () =>  {

   return  (
    <Layout>
        <div>
           
           <button>Login</button>

           <Dashboard />
        </div>
    </Layout>

    );
};






const Dashboard = () =>  {

    return  (
  
         <div>

            <button>Logout</button>

            
         </div>
  
 
     );
 };
 


export default Login;
